(4,'Mrs','Kofi','Grace','Okoro','1962-10-20','Other','0433 475 348','Level 19 / 327 Elizabeth Blvd, Hornsby, Brisbane, SA, 5777','kofi.okoro4@example.com','Hannah Okoro','0412 533 068','Kofi Okoro is a 63-year-old patient presenting with a multifaceted history of chronic and intermittent symptoms affecting daily life. Over recent months, they have reported a variable pattern of discomfort, fluctuating energy levels, and difficulty maintaining concentration. Symptoms appear to worsen during periods of work-related stress, insufficient sleep, or extended sedentary activity, but occasionally improve with rest and structured exercise. The patient describes inconsistent dietary habits influenced by workload and family responsibilities. They deny recent fever, acute illness, or sudden functional decline but note gradual changes that have begun to impact productivity and emotional wellbeing. Past medical history includes minor episodic conditions that have been manageable but periodically interact with current symptoms. Family history suggests potential genetic predispositions, although no formal diagnoses have been confirmed. They aim to better understand symptom patterns, identify contributing lifestyle factors, and develop a sustainable long-term management plan including sleep optimisation, activity pacing, and holistic monitoring.'),
